import React, { useState, useEffect } from "react";
import { CSSTransition } from "react-transition-group";
import "./style.css";

function Header() {
  const [showHeader, setShowHeader] = useState(false);

  useEffect(() => {
    setShowHeader(true);
  }, []);

  return (
    <CSSTransition in={showHeader} classNames="header-animation" timeout={500}>
      <div className="header_opacity_container">
        <div>
          <h2>Ultra Profile</h2>
          <ul>
            <li>
              {" "}
              <a id="home_li" href="">
                HOME
              </a>
            </li>
            <li>
              {" "}
              <a id="work_li" href="">
                MY WORK
              </a>
            </li>
            <li>
              <a id="port_li" href="">
                PORTFOLIO
              </a>
            </li>
            <li>
              <a id="ressume_li" href="">
                RESUME
              </a>
            </li>
            <li>
              <a id="about_li" href="">
                ABOUT
              </a>
            </li>
            <li>
              <a id="contact_li" href="">
                CONTACT
              </a>
            </li>
          </ul>
        </div>
      </div>
    </CSSTransition>
  );
}

export default Header;
